import React from 'react';
import FaceRecogntion from './FaceRecognition.css'

const FaceRecognition = ({imageUrl, box}) => {
    return (
        <div>
            <img id='inputimage' src={imageUrl} alt='image' width='500px' height='auto' />
            <div className='bounding-box' style={{top: box.top_row, right: box.right_col, bottom: box.bottom_row, left: box.left_col}}></div>
        </div>
    );
}

export default FaceRecognition;
